    { title: 'مشخصات فنی', icon: <Setting /> },
    { name: 'برند' },
    { name: 'مدل' },
    { name: 'سال تولید' },
    { title: 'مکان خودرو', icon: <Location /> },
    { name: 'استان' },
    { name: 'شهر' },
    { title: ' مشخصات فنی خودرو', icon: <Document /> },
    { name: 'نوع خودرو' },
    { name: 'کیلومتر' },
    { name: 'گیربکس' },
    { name: 'سوخت' },
    { name: 'وضعیت بدنه' },
    { title: 'قیمت', icon: <Chart /> },
];

